import styled from "styled-components";

function HabitoHoje (props) {
    const {habito} = props;
    return (
        <Container>
        <h1>{habito}</h1>
        </Container>
    )
}

const Container = styled.div`
    width: 340px;
    height: 91px;
    border-radius: 5px;
    margin: 0 auto;
    margin-bottom: 0px;
    background-color: #FFFFFF;
`

export default HabitoHoje
